 INSERT INTO `ssc_played` VALUES ('2','五星复式','1','1','196000.00','170000.00','5','1','从万位、千位、百位、十位、个位各选一个号码组成一注。','从万位、千位、百位、十位、个位中选择一个5位数号码组成一注，所选号码与开奖号码全部相同，且顺序一致，即为中奖。','投注方案：12345，开奖号码：12345，即中五星直选','dxwf5f','ssc5xfs','fs','ssc','1','1','100000'),('3','五星单式','1','1','196000.00','170000.00','5','1','手动输入号码，至少输入1个五位数号码组成一注。','手动输入一个5位数号码组成一注，所选号码与开奖号码的万位、千位、百位、十位、个位相同，且顺序一致，即为中奖。','如：输入1234567890，则你投两注分别为12345和67890，如果开奖号为12345，则你中奖一注。','dxwf5d','ssc5xds','ds','ssc_dx_5d','0','2','100000'),('4','前四复式','1','1','19600.00','17000.00','4','66','从万位、千位、百位、十位各选一个号码组成一注。','从万位、千位、百位、十位中选择一个4位数号码组成一注，所选号码与开奖号码前4位相同，且顺序一致，即为中奖。','投注方案：1234，开奖号码：1234，即中前四直选','dxwfQ4f','sscqh4xfs','fs','ssc_dx_q4f','1','4','10000'),('5','前四单式','1','1','19600.00','17000.00','4','66','手动输入号码，至少输入1个四位数号码组成一注。','手动输入一个4位数号码组成一注，所选号码与开奖号码的万位、千位、百位、十位相同，且顺序一致，即为中奖。','投注方案：1234，开奖号码：1234，即中前四直选','dxwfQ4d','qh4ds','ds','ssc_dx_q4d','0','5','10000'),('6','后四复式','1','1','19600.00','17000.00','4','66','从千位、百位、十位、个位各选一个号码组成一注。','从千位、百位、十位、个位中选择一个4位数号码组成一注，所选号码与开奖号码相同，且顺序一致，即为中奖。','投注方案：1234，开奖号码：1234，即中四星直选','dxwfH4f','sscqh4xfs','fs','ssc_dx_h4f','1','6','10000'),('7','后四单式','1','1','19600.00','17000.00','4','66','手动输入号码，至少输入一个四位数号码组成一注。','手动输入一个4位数号码组成一注，所选号码与开奖号码的千位、百位、十位、个位相同，且顺序一致，即为中奖。','投注方案：1234，开奖号码：1234，即中四星直选。','dxwfH4d','qh4ds','ds','ssc_dx_q4d','0','7','10000'),('8','任四复式','1','1','19600.00','17000.00','4','76','从万位、千位、百位、十位、个位中选择四位各选1个号码组成一注。','从万位、千位、百位、十位、个位中选择四位各选1个号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。','投注方案：万位选1，百位选2，十位选3，个位选4。开奖号码：12234，即中任四直选。','dxwfR4f','rx4fs','fs','ssc_dx_r4f','1','7','10000'),('9','任四单式','1','1','19600.00','17000.00','4','76','从万位、千位、百位、十位、个位中选择四个位置，至少手动输入一个四位数的号码组成一注。',' 从万位、千位、百位、十位、个位中选择四个位置。至少手动输入一个四位数的号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。','投注方案：万位选1，百位选2，十位选3，个位选4。开奖号码：12234，即中任四直选。1*345，则为中奖，如果是13*45或134*5等都不中奖。','dxwfR4d','rx4ds','ds','ssc_dx_r4d','0','8','10000'),('10','前三复式','1','1','1960.00','1700.00','3','2','从万位、千位、百位各选一个号码组成一注。','从万位、千位、百位中选择一个